import React from 'react';
import { Link } from 'react-router-dom';

const Navigation = () => {
  return(
    <nav className="navigation">
      <ul className="navigation__pages">
        <Link className="navigation__page" to="/movies">Фильмы</Link>
        <Link className="navigation__page" to="/saved-movies">Сохранённые фильмы</Link>
      </ul>
      <ul className="navigation__links">
        <Link className="navigation__link" to="/signup">Регистрация</Link>
        <Link className="navigation__link" to="/signin">Войти</Link>
      </ul>
    </nav>
  )
};

export default Navigation;
